function polygon_fadeout(polygon,opacity,seconds,callback){
	var fill = (polygon.fillOpacity*50)/(seconds*999),
	stroke = (polygon.strokeOpacity*50)/(seconds*999),
    fadeout = setInterval(function(){
        if(polygon.fillOpacity == 0.0){
            clearInterval(fadeout);
            // polygon.setVisible(false);
            if(typeof(callback) == 'function')
                callback();
            return;
        }
        polygon.setOptions({
            'fillOpacity': Math.max(0, polygon.fillOpacity-fill),
            // 'strokeOpacity': Math.max(0, polygon.strokeOpacity-stroke)
        });
    }, 50);
}
function polygon_fadein(polygon,opacity,seconds,callback){
	var fill = (opacity*50)/(seconds*999),
	stroke = (polygon.strokeOpacity*50)/(seconds*999),
    fadeout = setInterval(function(){
        if(polygon.fillOpacity >= opacity){
            clearInterval(fadeout);
            // polygon.setVisible(true);
            if(typeof(callback) == 'function')
                callback();
            return;
        }
        polygon.setOptions({
            'fillOpacity': polygon.fillOpacity+fill,
            // 'strokeOpacity': Math.max(0, polygon.strokeOpacity+stroke)
        });
    }, 50);
}
function polygon_fade(polygon,opacity,seconds,callback){
	ds = opacity - polygon.fillOpacity;
	cc = seconds*1000/50;
	ds = ds / cc ;
    fade = setInterval(function(){
    	if(cc==0){
    		clearInterval(fade);
    	}
    	cc = cc - 1;
        polygon.setOptions({
            'fillOpacity': polygon.fillOpacity+ds,
            // 'strokeOpacity': Math.max(0, polygon.strokeOpacity+stroke)
        });
    }, 50);
}